    return (
        <div>
            <textarea 
                placeholder="Type something..."
                value={content}
                onChange={handleCreate}>
            </textarea>
            <div className="note-footer">
                {characterLimit - content.length} Remaining
                <input type="image" src={saveIcon} alt="Submit" onClick={handleCreateClick} align="right"></input>
            </div> 
        </div>
    )
}
